outcomeMeasures.description:
Booster response to the pertussis components is defined as:

* For initially seronegative subjects, antibody concentration ≥ 4\*cut\_off (IU/mL) at one month post-vaccination;
* For initially seropositive subjects with pre-vaccination antibody concentration \< 4\*cut\_off (IU/mL) : antibody concentration at one month post-vaccination ≥ 4 fold the pre-vaccination antibody concentration;
* For initially seropositive subjects with pre-vaccination antibody concentration ≥ 4\*cut\_off (IU/mL) : antibody concentration at one month post-vaccination ≥ 2 fold the pre-vaccination antibody concentration.
